import { useSelector } from "react-redux";
import { RouteObject, useRoutes } from "react-router-dom";
import Loader from "./Loader/Loader";
import { routeObject } from "./Router/RouteObject";


export default function App() {

  const LoaderState = useSelector((state: any) => state.LoaderReducer);
  // const UserData = useSelector((state: any) => state.UserReducer);

  function LoaderStatus({ children }: { children: JSX.Element }) {

    if (LoaderState == true) {
      return <Loader />
    }
    return children;
  }

  let routes: RouteObject[] = routeObject
  let element:any = useRoutes(routes);


  return (
    <div className="App">
      <LoaderStatus >
        {element}
      </LoaderStatus>
    </div>
  );
}
